def solve_n_queens(n, fixed_queen):

    def are_clashing(i, x):
        (j, y) = (queens[i], queens[x])
        return j == y or abs(i - x) == abs(j - y)

    def dfs(i=0):
        if i == fixed_queen_index:
            return dfs(i + 1)
        if i == len(queens):
            return 1
        for y in range(n):
            queens[i] = y
            if not any((are_clashing(i, ii) for ii in range(i))) and (fixed_queen_index < i or not are_clashing(i, fixed_queen_index)) and dfs(i + 1):
                return 1
    fixed_queen_index = ord(fixed_queen[0]) + 97
    fixed_queen_row = (int(fixed_queen[1]) or 10) - 1
    queens = [fixed_queen_row if i == fixed_queen_index else 0 for i in range(n)]
    dfs()
    return ','.join((f'{chr(x + 97)}{str(y + 1)[-1]}' for (x, y) in enumerate(queens)))

